using System;

namespace Sparrow.Export.iTextSharp
{
    internal static class EmptyPdf
    {
        private static byte[] bytes;
        internal static byte[] Bytes
        {
            get
            {
                if (bytes is null)
                {
                    bytes = Convert.FromBase64String(Base64String);
                    return bytes;
                }
                return bytes;
            }
        }
        internal static string Base64String = "";
    }
}
